      RECURSOS_ACUM = 0;
      this.returnParms ( ps, SALARIO, SALARIO_CONYUGUE, OTROS, INGRESO_BRUTO, OPEN_ID, OPEN2_ID, OPEN3_ID, OPEN4_ID, OPEN5_ID, OPEN6_ID, OPEN7_ID, OPEN12_ID, ACREDITABLE_CONYUGUE, CONY_PROD, CONYUGUE_INHERENTES, JEFE_OTROS, CONY_OTROS );
      this.doReturn ( );
      return; 
